{
  "src/**/*.ts": ["prettier --write", "npm run lint"],
  "*.{json,md}": ["prettier --write"]
}

{
  "default": true,
  "fenced-code-language": false,
  "first-line-h1": false,
  "line-length": false,
  "no-inline-html": false,
  "no-trailing-punctuation": {
    "punctuation": ",;:"
  },
  "ol-prefix": {
    "style": "ordered"
  },
  "ul-indent": { "indent": 2 },
  "ul-style": false
}

module.exports = {
  extends: ['ccgls'],
};

import { defineConfig } from 'cypress'

export default defineConfig({
  fixturesFolder: './cypress/fixtures',
  screenshotsFolder: './cypress/screenshots',
  videosFolder: './cypress/videos',
  projectId: 'ngfcig',
  e2e: {
    // We've imported your old cypress plugins here.
    // You may want to clean this up later by importing these.
    setupNodeEvents(on, config) {
      return require('./cypress/plugins/index.js')(on, config)
    },
    baseUrl: 'http://localhost:8111/packages/',
    specPattern: './packages/**/__e2e__/**/*.spec.js',
  },
})

module.exports = {
  collectCoverageFrom: [
    'packages/**/src/**/*.ts',
    '!packages/**/src/**/*.d.ts',
    '!packages/**/src/typings.ts',
    '!packages/**/src/**/index.ts',
    '!packages/**/src/polyfills/**.ts',
    '!packages/core/src/utils/helpers.ts',
  ],
  coverageThreshold: {
    global: {
      statements: 95,
      branches: 95,
      functions: 95,
      lines: 95,
    },
  },
  preset: 'ts-jest',
  resetMocks: true,
  testEnvironment: 'jest-environment-jsdom-global',
  testMatch: ['**/__tests__/**/*.test.ts'],
  transformIgnorePatterns: ['<rootDir>.*(node_modules)(?!.*@barba.*).*$'],
  verbose: true,
  watchPlugins: ['jest-watch-lerna-packages'],
};

{
  "command": {
    "publish": {
      "conventionalCommits": true,
      "message": "chore(release): üîñ publish",
      "npmClient": "npm"
    },
    "version": {
      "allowBranch": "main"
    }
  },
  "npmClient": "yarn",
  "packages": [
    "packages/*"
  ],
  "version": "independent",
  "$schema": "node_modules/lerna/schemas/lerna-schema.json"
}

module.exports = {
  printWidth: 80,
  tabWidth: 2,
  useTabs: false,
  semi: true,
  singleQuote: true,
  trailingComma: 'es5',
  bracketSpacing: true,
  arrowParens: 'avoid',
  overrides: [
    {
      files: '*.md',
      options: {
        parser: 'markdown',
      },
    },
  ],
};

{
  "compilerOptions": {
    "resolveJsonModule": true,
    "strict": true,
    "strictNullChecks": false,
    "useUnknownInCatchVariables": false,
    "esModuleInterop": true,
    "target": "es5",
    "plugins": [
      {
        "name": "typescript-tslint-plugin",
        "alwaysShowRuleFailuresAsWarnings": false,
        "ignoreDefinitionFiles": true,
        "configFile": "./tslint.json",
        "suppressWhileTypeErrorsPresent": false,
        "mockTypeScriptVersion": false
      }
    ]
  },
  "exclude": [
    "node_modules",
    "**/__*__/**/*",
    "**/polyfills/index.d.ts",
    "./cypress.config.ts"
  ]
}

{
  "extends": "./tsconfig",
  "compilerOptions": {
    "module": "esnext",
    "moduleResolution": "node",
    "skipLibCheck": true
  },
  "typedocOptions": {
    "exclude": "**/index.ts",
    "excludeExternals": true,
    "ignoreCompilerErrors": true,
    "name": "barba.js",
    "readme": "README.md",
    "out": "documentation/api",
    "theme": "documentation/theme"
  }
}
